import React from 'react';
import style from './content.module.css';

function Modal({ data }) {
  const { photo, comments } = data;
  return (
    <div className={style.photo}>
      <div className={style.img}>
        <img src={photo.src} alt={photo.alt} />
      </div>
    </div>
  );
}

export default Modal;
